import React from "react";

import { onRequest } from "../Common";

export const useHome = () => {
  const fetchPosts = async () => {
    try {
      const response = await onRequest();
      if (response.status === 200) {
        const posts = response.data;
      } else {
        throw response;
      }
    } catch (e) {
      console.log("fail");
    }
  };

  return {
    fetchPosts,
    posts,
  };
};
